  \"environmental-assessment-for-public-deer-hunting-at-james-river-national-wildlife-refuge-1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"An excessively high deer population will
  conflict with any forest management program conducted at James River National Wildlife
  Refuge. To accomplish the objective of maintaining the refuge deer population commensurate
  with the biological carrying capacity of the available refuge habitat and to provide
  a high quality wildlife oriented experience, a total of four alternatives were considered.
  Five other approaches were also considered, and dismissed. The approaches and alternatives
  are all outlined in this report.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
